    <div className="feeback-container">
      <h2>Feedback</h2>
      <div className="main-container">
        <section className="left-container">
          <DatePicker
            onChange={(e: any) => {
              fetchFeedback(Dateformatter(e.$d, true));
            }}
            value={dayjs(date)}
            format={"DD/MM/YYYY"}
            className="datepicker"
          />
          <div className="list-of-feedback">
            <h2>New Notification</h2>
            {feedback.map((item, index) => {
              return <FeedbackInfo data={item} key={index} index={index} active={activeclass===index?"unseencard":"info-card" } callback={(data:FeedbackInfoCard,i:number)=>{
